import "./App.css";
import SideBar from "./components/SideBar";
import Home from "./components/Home";
import { ContextProvider, Context } from "./statemanagement/Context";
import React, { useContext } from "react";
function App() {

  const { user } = useContext(Context);

  return (
    <ContextProvider>
      <div className="App">
      {!user }
        <SideBar />
        <Home />
      </div>
    </ContextProvider>
  );
}

export default App;
